# 각 자리수에서 가능한 경우의 수를 구하는 함수
def get_num(digit):
    if digit <= 1:
        return 1
    else:
        return 10 * get_num(digit - 1) + pow(10, digit - 1)

# 각 자리수별로 가능한 경우의 수를 구하는 함수
def get_num_list(digit):
    num_list = []
    for i in range(digit):
        num_list.append(get_num(i + 1))
    return num_list

